window.onload = function()
{
	// キャンパスを取得
	const canvas = document.getElementById("myCanvas");
	
	// 描画コンテキストを取得
	const ctx = canvas.getContext("2d");
	
	// 画面のアスペクト比
	const aspectRatio = 16 / 9;
	
	// ベース画像
	const baseImage = new Image();
	
	
	// 初期設定でキャンバスのサイズを調整
	adjustCanvasSize();
	
	
	
	//********以下関数定義・イベント登録********
	
	// 画面サイズが変更された時にキャンバスサイズを再調整
	window.addEventListener("resize", adjustCanvasSize);
	
	// キャンバスのサイズを設定する関数
	function adjustCanvasSize()
	{
		// 画面の幅の80%に合わせて設定（任意の比率に変更可能）
		const width = 1280;
		//const width = window.innerWidth * 0.9;
		
		// アスペクト比に基づいて高さを計算
		const height = width / aspectRatio;
		
		// キャンバスの幅と高さを設定
		canvas.width = width;
		canvas.height = height;
		
		// 画像の読み込み
		// ベースとなる画像のパス
		baseImage.src = 'data:image/jpeg;base64,';

		// キャンバスに描画
		baseImage.onload = () =>
		{
			ctx.drawImage(baseImage, 0, 0, canvas.width, canvas.height);
		
			// テキストの描画
			drawText();
			
			// 画像ダウンロードボタンの更新
			updateDownloadButton();
		}
	}
	
	// 入力テキストを描画する関数
	function drawText()
	{
		// ユーザー入力
		const yourNameText = document.getElementById("yourName").value;
		const genre01Text = document.getElementById("genre01").value;
		const genre02Text = document.getElementById("genre02").value;
		const genre03Text = document.getElementById("genre03").value;
		const genre04Text = document.getElementById("genre04").value;
		const genre05Text = document.getElementById("genre05").value;
		const genre06Text = document.getElementById("genre06").value;
		const genre07Text = document.getElementById("genre07").value;
		const genre08Text = document.getElementById("genre08").value;
		const genre09Text = document.getElementById("genre09").value;
		const genre10Text = document.getElementById("genre10").value;
		const genre11Text = document.getElementById("genre11").value;
		const genre12Text = document.getElementById("genre12").value;
		const genre13Text = document.getElementById("genre13").value;
		const commentText = document.getElementById("comment").value;
		
		// 表示名
		const titleFontSize = Math.floor(canvas.width * 0.05); // 幅の10%をフォントサイズに
		ctx.font = `${titleFontSize}px Arial`;
		ctx.textAlign = "right";
		ctx.fillStyle = "white";
		ctx.fillText(yourNameText, canvas.width / 2, canvas.height / 32 + titleFontSize / 2);
		
		// 各ジャンル
		const normalFontSize = Math.floor(canvas.width * 0.025); // 幅の5%をフォントサイズに
		ctx.font = `${normalFontSize}px Arial`;
		ctx.textAlign = "left";
		ctx.fillText(genre01Text, canvas.width / 32,                    canvas.height / 2 - canvas.height / 16 * 5 + normalFontSize / 2);
		ctx.fillText(genre02Text, canvas.width / 32,                    canvas.height / 2 - canvas.height / 16 * 3 + normalFontSize / 2);
		ctx.fillText(genre03Text, canvas.width / 32,                    canvas.height / 2 - canvas.height / 16 * 1 + normalFontSize / 2);
		ctx.fillText(genre04Text, canvas.width / 32,                    canvas.height / 2 + canvas.height / 16 * 1 + normalFontSize / 2);
		ctx.fillText(genre05Text, canvas.width / 32,                    canvas.height / 2 + canvas.height / 16 * 3 + normalFontSize / 2);
		ctx.fillText(genre06Text, canvas.width / 32,                    canvas.height / 2 + canvas.height / 16 * 5 + normalFontSize / 2);
		ctx.fillText(genre13Text, canvas.width / 32,                    canvas.height / 2 + canvas.height / 16 * 7 + normalFontSize / 2);	// ワイルドカード
		ctx.fillText(genre07Text, canvas.width / 2 + canvas.width / 32, canvas.height / 2 - canvas.height / 16 * 5 + normalFontSize / 2);
		ctx.fillText(genre08Text, canvas.width / 2 + canvas.width / 32, canvas.height / 2 - canvas.height / 16 * 3 + normalFontSize / 2);
		ctx.fillText(genre09Text, canvas.width / 2 + canvas.width / 32, canvas.height / 2 - canvas.height / 16 * 1 + normalFontSize / 2);
		ctx.fillText(genre10Text, canvas.width / 2 + canvas.width / 32, canvas.height / 2 + canvas.height / 16 * 1 + normalFontSize / 2);
		ctx.fillText(genre11Text, canvas.width / 2 + canvas.width / 32, canvas.height / 2 + canvas.height / 16 * 3 + normalFontSize / 2);
		ctx.fillText(genre12Text, canvas.width / 2 + canvas.width / 32, canvas.height / 2 + canvas.height / 16 * 5 + normalFontSize / 2);
		
		// コメント
		ctx.fillText(commentText, canvas.width / 2 + canvas.width / 32, canvas.height / 2 + canvas.height / 16 * 7 + normalFontSize / 2);
	}
	
	// 画像ダウンロードボタンの更新
	function updateDownloadButton()
	{
		// 画像ダウンロードリンクを表示
		const dataUrl = canvas.toDataURL("image/png");
		const downloadLink = document.getElementById("downloadLink");
		downloadLink.href = dataUrl;
		downloadLink.style.display = "inline-block";
	}
	
	// 画像生成ボタン
	document.getElementById("generateBtn").addEventListener("click", function()
	{
		//console.log("click!!");
		
		// キャンバスを完全にクリア
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		
		// 再描画
		adjustCanvasSize();
	});
}
